import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ChatWidget from './components/ChatWidget';

const App = () => {
  return (
    <Router>
      <Routes>
        <Router>
          <Routes>
            {/* Define route for ChatWidget component with path="/chat-widget/:props1/:props2" */}
            <Route path="/chat-widget/:props1/:props2" element={<ChatWidget />} />
          </Routes>
        </Router>
      </Routes>
    </Router>
  );
}

export default App;
